import React, { useState } from "react";
import "./styles.css";

const App = () => {
  const [menuOpen, setMenuOpen] = useState(false);
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState(""); // Estado para almacenar el rol (usuario o administrador)
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  const handleLogin = (e) => {
    e.preventDefault();
    // Simulamos un proceso de autenticación con credenciales predefinidas
    if (username === "admin" && password === "1234") {
      setRole("admin");
      setIsLoggedIn(true);
    } else if (username === "user" && password === "abcd") {
      setRole("user");
      setIsLoggedIn(true);
    } else {
      alert("Credenciales incorrectas");
    }
  };

  const handleLogout = () => {
    setIsLoggedIn(false);
    setUsername("");
    setPassword("");
    setRole("");
  };

  return (
    <div className={`App ${menuOpen ? "open" : ""}`}>
      {!isLoggedIn ? (
        <div className="login-form">
          <h2>Iniciar Sesión</h2>
          <form onSubmit={handleLogin}>
            <div>
              <label>Usuario:</label>
              <input
                type="text"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                required
              />
            </div>
            <div>
              <label>Contraseña:</label>
              <input
                type="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
              />
            </div>
            <button type="submit">Ingresar</button>
          </form>
        </div>
      ) : role === "admin" ? (
        // Vista del Administrador
        <>
          <h1>Bienvenido, Administrador</h1>
          <button className="burger" onClick={toggleMenu}></button>
          <div className="background"></div>
          <div className="shade"></div>
          <div className="menu">
            <nav>
              <a href="admin-dashboard.html" className="button" style={{ animationDelay: "0.2s" }}>Panel de Control</a>
              <a href="admin-usuarios.html" className="button" style={{ animationDelay: "0.3s" }}>Gestionar Usuarios</a>
              <a href="admin-config.html" className="button" style={{ animationDelay: "0.4s" }}>Configuración</a>
            </nav>
            <button className="logout-button" onClick={handleLogout}>Cerrar Sesión</button>
          </div>
        </>
      ) : (
        // Vista del Usuario
        <>
          <h1>Bienvenido, Usuario</h1>
          <button className="burger" onClick={toggleMenu}></button>
          <div className="background"></div>
          <div className="shade"></div>
          <div className="menu">
            <nav>
              <a href="Juego.html" className="button" style={{ animationDelay: "0.2s" }}>Kia Drive Deck</a>
              <a href="tutorial.html" className="button" style={{ animationDelay: "0.3s" }}>Tutorial</a>
              <a href="perfil.html" className="button" style={{ animationDelay: "0.4s" }}>Perfil</a>
            </nav>
            <button className="logout-button" onClick={handleLogout}>Cerrar Sesión</button>
          </div>
        </>
      )}
    </div>
  );
};

export default App;
